import { Component } from '@angular/core';
import { CourseService } from '../services/course.service';

@Component({
  selector: 'app-view-courses',

  templateUrl: './view-courses.component.html',
  styleUrl: './view-courses.component.css'
})
export class ViewCoursesComponent {
  courses: any;
  sideNavStatus: boolean = false;
  constructor(private serv: CourseService) { }
  getCourses() {
    this.serv.getCourses().subscribe(res => {
      this.courses = res.data;
    });

  }

}
<div class="container-fluid g-0">
    <app-nav (sideNavToggled)="sideNavStatus= $event;"></app-nav>

    <main>
        <app-side-nav [sideNavStatus]="sideNavStatus" [ngClass]="{'app-side-nav-open':sideNavStatus}"></app-side-nav>
        <router-outlet></router-outlet>

    </main>
</div>
<body>
    <h1>Hello</h1>
    <table mat-table class="mat-elevation-z8 demo-table">
        <!-- Position Column -->
        <ng-container matColumnDef="position">
            <th mat-header-cell  >No.</th>
            <td mat-cell></td>
        </ng-container>

        <!-- Name Column -->
        <ng-container matColumnDef="name">
            <th mat-header-cell >Name</th>
            <td mat-cell *matCellDef=""></td>
        </ng-container>

        <!-- Weight Column -->
        <ng-container matColumnDef="weight">
            <th mat-header-cell >Weight</th>
            <td mat-cell *matCellDef=""></td>
        </ng-container>

        <!-- Symbol Column -->
        <ng-container matColumnDef="symbol">
            <th mat-header-cell >Symbol</th>
            <td mat-cell * =""></td>
        </ng-container>


    </table>


</body>


